import React from "react";
import TopNav from '../components/Navbar/TopNav';
//import { useNavigate } from 'react-router-dom';
const Main = () => {
return (
	<div className='full_div'>
		<TopNav />
		<div>
			<input 
  			type="text" 
  			placeholder="Search products..."
  			style={{
  			  backgroundColor: '#ccc',
  			  borderRadius: '10px',
  			  padding: '-10px',
  			  border: 'none',
  			  width: '200px',
  			  textAlign: 'left',
  			  marginBottom: '10px'	
  			}}
		/>

		</div>

    </div>
);
};

export default Main;
